import React from "react";

function ActivitiesPage() {
  return (
    <div className="p-10">
      <h1 className="text-3xl font-bold text-blue-600 mb-4">All Activities</h1>
      <p className="text-lg text-gray-700">
        Here we will show all activity-related tours and info. You can later filter or display sections depending on the activity clicked.
      </p>
    </div>
  );
}

export default ActivitiesPage;
